import React from "react";

import "./error-message.styles.scss";

const WithErrorMessage = (WrappedComponent) => {
  const Error = ({ error, ...otherProps }) => {
    return error ? (
      alert(error)
    ) : (
      <WrappedComponent {...otherProps} />
    );
  };
  return Error;
};

export default WithErrorMessage;
